import React from 'react';

export default function Card (props){
    { props.card.num } { card.suit }
    return (
        <div className="card">
            <div className="card-top">
                <div>num</div>
                <div>suit</div>
            </div>
            <div className="card-bottom">
                <div>num</div>
                <div>suit</div>
            </div>
        </div>
    )
}
